<script>
import Vue from 'vue'
import { mapState, mapMutations } from 'vuex'
import { gsap } from 'gsap'
import 'lazysizes'
export default {
  computed: {
    ...mapState(['gameTitleCharacters'])
  },
  data() {
    const titleCharacterTransforms = [...Array(5)]
      .map(element => ({
        x: 0,
        y: 0,
        scale: 1
      }))
    return {
      titleCharacterTransforms
    }
  },
  methods: {
    start() {
      this.updateCurrentSubview({ value: 'chooseObject' })
    },
    ...mapMutations([
      'updateCurrentSubview'
    ]),
    $_calcTitleCharacterTransforms() {
      this.$refs.titleCharacters
        .forEach((titleCharacter, index) => {
          const bounding = titleCharacter.getBoundingClientRect()
          const boundingEnd = this.$refs.titleCharactersEndState[index].getBoundingClientRect()

          const deltaX = boundingEnd.x + boundingEnd.width / 2 - (bounding.x + bounding.width / 2)
          const deltaY = boundingEnd.y + boundingEnd.height / 2 - (bounding.y + bounding.height / 2)
          const deltaScale = boundingEnd.width / bounding.width

          this.$set(this.titleCharacterTransforms, index, {
            x: deltaX ,
            y: deltaY ,
            scale: deltaScale
          })
        })
    },
    $_tweenTitleCharacters() {
      const timeline = gsap.timeline()
      for (
        let i = 0; 
        i < this.titleCharacterTransforms.length; 
        i++
      ) {
        const tween = gsap.to(
          this.$refs.titleCharacters[i],
          .75,
          Object.assign({},
            this.titleCharacterTransforms[i],
            {
              ease: "elastic.out(1, 0.75)"
            }
          )
        )
        timeline.add(tween, `<${i*.05}`)
      }
      return timeline
    }
  },
  mounted() {
    this.$_calcTitleCharacterTransforms()
    window.lala = this
  }
}
</script>
